create table credits_random_data (
	owner_id INT,
	credit_value INT,
	interest_rate DECIMAL(3,2),
	date DATE,
	length INT
);

CREATE OR REPLACE FUNCTION populate_credits_data()
  returns void
language plpgsql
as $$
DECLARE
   t_row credits_random_data%rowtype;

BEGIN
    FOR t_row in SELECT * FROM credits_random_data LOOP
        PERFORM open_credit_account(t_row.owner_id, t_row.credit_value, t_row.interest_rate, t_row.length);
    END LOOP;
END;
$$;

SELECT populate_credits_data();

DROP TABLE credits_random_data;
